import React from 'react'
import './App.css';
import ProfilePic from './Components/ProfilePic';
import Sidenav from './Components/Sidenav';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Sidenav />
        <ProfilePic />
      </div>
    );
  }
}

export default App;
